import "./case.module.scss";
import Link from "next/link";
import Item from "../Item/Item";
import React, { Component } from "react";

export default class Case extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Link href='/case/[id]' as={"/case/" + this.props.id}>
        <a className='case'>
          <Item type={6} image={this.props.img} weapon={this.props.title} />
        </a>
      </Link>
    );
  }
}
